import React, { Component } from 'react';
import { connect } from 'react-redux';
import { FormattedMessage } from 'react-intl';
import "./HomeFooter.scss";

class HomeFooter extends Component {

    render() {

        return (
            <div className='home-footer-container'>
                <div className='home-footer-content-left'>
                    <div className='home-footer-title'>BaiAquatic
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'>
                        <h5><b>CÔNG TY TNHH MTV ĐỨC TUẤN</b></h5>
                        <h5><b><i className='fas fa-envelope">'></i>Địa chỉ: Phước An, Lộc Tiến, Phú Lộc, T.T.Huế</b></h5>
                        <h5><b>Điện thoại: (012)3456789 - Hotline: 0123456789</b></h5>
                        <h5><b>Email: bai.aqua@gmail.com</b></h5>
                    </div>
                </div>
                <div className='home-footer-content-cennter'>
                    <div className='home-footer-title'>Bản đồ
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'>
                        <iframe
                            src="https://www.google.com/maps/place/L%E1%BB%99c+Ti%E1%BA%BFn,+Ph%C3%BA+L%E1%BB%99c,+Hu%E1%BA%BF/@16.3142709,107.9004566,13z/data=!4m10!1m2!2m1!1zVGjDtG4gUGjGsOG7m2MgYW4sIEzhu5ljIFRp4bq_biwgUGjDuiBM4buZYywgVC5ULkh14bq_!3m6!1s0x3141899f729832dd:0x848ccd7711d508d6!8m2!3d16.2696999!4d107.980792!15sCjZUaMO0biBQaMaw4bubYyBhbiwgTOG7mWMgVGnhur9uLCBQaMO6IEzhu5ljLCBULlQuSHXhur9aNCIydGjDtG4gcGjGsOG7m2MgYW4gbOG7mWMgdGnhur9uIHBow7ogbOG7mWMgdHQgaHXhur-SAQdmbG9yaXN04AEA!16s%2Fg%2F11jyynp0h6"
                            width="100%"
                            height="100%"
                            frameborder="0"
                            allowfullscreen
                            aria-hidden="false"
                            tabindex="0"></iframe>
                    </div>
                </div>
                <div className='home-footer-content-right'>
                    <div className='home-footer-title'>Fanpage
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'></div>
                </div>
            </div>
        );
    };

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeFooter);
